import styles from "./NavPages.module.css";

export default function NavPages({
  setPaginaActual,
  recipesPerPage,
  allRecipes,
}) {
  let paginas = [];

  for (let i = 0; i < Math.floor(allRecipes / recipesPerPage); i++) {
    paginas.push(i);
  }
  console.log(allRecipes);
  console.log(Math.floor(allRecipes / recipesPerPage));
  return (
    <div className={styles.Contenedor}>
      {paginas.map((element) => {
        return <p>{element}</p>;
      })}
      .
    </div>
  );
}
